import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';


function App() {
  return (

    <Router>
      <Switch>
        <Route exact path="/">
          {/* Login */}
        </Route>
        <Route exact path="/Children">
          {/* Children */}
        </Route>
        <Route exact path="/Adults">
          {/* Adults*/}
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
